class Testimoni {
    #coment
    #image

    constructor(coment, image){
        this.#coment= coment
        this.#image= image
    }

    get coment(){
        return this.#coment
    }

    get image(){
        return this.#image
    }

    get author(){
        throw new Error("getAuthor() method must be implemented")
    }

    get testimoniHTML() {
        return `  <div class="testimonial">
        <img src="${this.image}" alt="" class="profil-testimonial"/>
        <p class="coment">${this.coment}</p>
        <p class="author">- ${this.author}<i class="fa-solid fa-star"></i>
    </div>`;
    }
}

//  kelas turunan

class AuthorTestimoni extends Testimoni {
    #author= "";

    constructor(author, coment, image){
        super(coment, image);
        this.#author = author;
    }

    get author(){
        return this.#author;
    }
}

class CorporateTestimoni extends Testimoni{
    #corporate="";

    constructor(corporate, coment, image){
        super(coment, image);
        this.#corporate= corporate;
    }

    get author(){
        return this.#corporate   
    }   
}

const testimoni1 = new CorporateTestimoni(
    "adipati",
    "lebih baik digaji 10jt tapi penuh syukur dari pada digaji 5jt tapi selalu mengeluh ",
    "data:image/jpeg;base64,"
);

const testimoni2 = new AuthorTestimoni(
    "NACHT ANAK IBLIS",
    "Kebanyakan berteman dengan iblis juga tidak baik, lebih baik berteman dengan janda pirang",
    "data:image/jpeg;base64,"
);

const testimoni3 = new AuthorTestimoni(
    "jefril jengkol",
    "uang bukan segalanya tapi segalanya butuh uang... memang membagongkan dunia ini",
    "data:image/jpeg;base64,"
)

let testimoniData = [testimoni1, testimoni2, testimoni3];
let testimoniHTML = "";

for (let i = 0; i < testimoniData.length; i++) {
    testimoniHTML += testimoniData[i].testimoniHTML;
}

document.getElementById("testimoni").innerHTML = testimoniHTML